import React from 'react'
import appIcon from "../../images/application-icon.png";
import blockChainIcon from "../../images/blockchain-black.png";
import "./IntroImage.styles.scss";
import {Container, Button, Image, Row, Col} from 'react-bootstrap';

const IntroImage = () => {
  return (
    <>
      <Row className="backgroundImgDiv">
        <Col md={3}>
          <Image src={blockChainIcon} alt="blockchain icon" width="50%" />
        </Col>
        <Col md={6}>
          <h1>I'm Daniel...</h1>
          <img src={appIcon} alt="application icon" className="" />
          <h2>...a blockchain and web app developer!</h2>
        </Col>
        <Col md={3}>
          <Image src={blockChainIcon} alt="blockchain icon" width="40%" />
          <div class="spinner-border text-primary" role="status">
            <span class="sr-only">Loading...</span>
          </div>
        </Col>
      </Row>
      <Container>
        <h1>React-Bootstrap Container</h1>
        <Button variant="primary">Primary</Button>
        <Button variant="outline-primary">Primary</Button>{" "}
      </Container>
    </>
  );
}

export default IntroImage
